// [[Rcpp::plugins(cpp11)]]
// [[Rcpp::export]]
double tripleDip(const std::vector<double>& x) {
  double currentDip = 1.0;
  double tmpDip = 1.0;
  double dip_1 = 0, dip_2 = 0, dip_3=0;
  double *p_dip_1 = &dip_1, *p_dip_2 = &dip_2, *p_dip_3 = &dip_3;
  const int N = x.size();
  if (N > 400) {
    std::cerr << "P-values for more than 400 observations not supported" << std::endl;
    return -1.0;
  }

  int N1 = 0, N2 = 0, N3=0;
  int *n1 = &N1, *n2 = &N2, *n3 = &N3;
  
  int ifault = 0;
  int *ifault_1 = &ifault;
  std::vector<int> lo_hi_1(4,0);
  std::vector<int> lo_hi_2(4,0);
  std::vector<int> lo_hi_3(4,0);
  const int min_is_0 = 0;
  const int *min_is_0_1 = &min_is_0;
  const int debug_status = 0;
  const int *debug_1 = &debug_status;

  /*
  double X [N];
  int gcm [N];
  int lcm [N];
  int mn [N];
  int mj [N];
  */
  
  //allocate on heap
  double* X = new double[N];
  int* gcm = new int[N];
  int* lcm = new int[N];
  int* mn = new int[N];
  int* mj = new int[N];

  //Initialize X
  for (int k=0; k < N; k++) {
    X[k]=x[k];
    gcm[k]=0;
    lcm[k]=0;
    mn[k]=0;
    mj[k]=0;
  }

  double ratio_1, ratio_2, ratio_3, temp_dip_1, temp_dip_2, temp_dip_3;

  //Iteratively compute DIP
  for (int i = 3; i < (N-9); i++) {
    for (int j = (i+3); j < (N-5); j++) {
      N1 = i;
      //maechler_diptst_2(&X[0], n1, p_dip_1, &lo_hi_1[0], ifault_1,
      cppdip(&X[0], n1, p_dip_1, lo_hi_1, ifault_1,
	     &gcm[0], &lcm[0], &mn[0], &mj[0],
	     min_is_0_1, debug_1);

      ifault = 0; //reset ifault for next call
      ratio_1 = ((double) i)/(std::sqrt((double) N));
      temp_dip_1 = (*p_dip_1) * ratio_1;

      N2 = (j-i);
      cppdip(&(X[i]), n2, p_dip_2, lo_hi_2, ifault_1,
	     &(gcm[i]), &(lcm[i]), &(mn[i]), &(mj[i]),
	     min_is_0_1, debug_1);

      ifault = 0; //reset ifault for next call
      ratio_2 = ((double) (j-i))/(std::sqrt((double) N));
      temp_dip_2 = (*p_dip_2) * ratio_2;
      N3 = (N-j);
      cppdip(&(X[j]), n3, p_dip_3, lo_hi_3, ifault_1,
	     &(gcm[j]), &(lcm[j]), &(mn[j]), &(mj[j]),
	     min_is_0_1, debug_1);

      ifault = 0; //reset ifault for next call
      ratio_3 = ((double) (N-j))/(std::sqrt((double) N));
      temp_dip_3 = (*p_dip_3) * ratio_3;

      //update Dip
      tmpDip = std::min(currentDip,std::max(std::max(temp_dip_1,temp_dip_2),temp_dip_3));
      currentDip = tmpDip;
      //clean up containers for next iteration
      std::fill(lo_hi_1.begin(),lo_hi_1.end(),0);
      std::fill(lo_hi_2.begin(),lo_hi_2.end(),0);
      std::fill(lo_hi_3.begin(),lo_hi_3.end(),0);
    }
  }

  //clean up heap
  delete[] X;
  delete[] gcm;
  delete[] lcm;
  delete[] mn;
  delete[] mj;

  std::vector<double> crit_values = _dip3_critical_values_[(N-1)];
  int cvloc = -1;
  if (crit_values[99] <= currentDip) {
    cvloc = 0;
  }
  else if (crit_values[0] >= currentDip) {
    cvloc = 100;
  }
  else {
    for (int i = 0; i < 99; i++) {
      if ((cvloc == -1) && (crit_values[(i+1)] > currentDip) && (crit_values[i] <= currentDip)) {
	cvloc = 100-i-1;
	break;
      }
    }
  }
  if (cvloc == -1) {
    std::cout << currentDip << std::endl;
    std::cout << crit_values[0] << std::endl;
    std::cout << crit_values[99] << std::endl;
  }
  return ((double(cvloc)/100.0));
}
